sys_variable_value.value:
(function execute(inputs, outputs) {
 var gutils = new GoogleIdentityAccessUtils();
  var message = gutils.validateTheInputs(inputs);
  if (!message == 'Ok') { 
     throw new Error(message); 
  } 
})(inputs, outputs);

